import './App.css';
import Login from './components/login/Login';
import Home from './components/home/Home';
import { HashRouter as Router, Route, Link, Switch } from "react-router-dom";
import React, { Component } from 'react';
import axios from 'axios'



class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      userinfo: ''
    };
  }

  submit = (info) => {

    window.location.href = "/home/home";
    this.setState({
      userinfo: info
    })

    axios.post('https://www.baidu.com', { ...this.state }).then(
      res => {
        if (res.user === this.state.user && res.password === this.state.password) {
          window.location.href = "/home/home";


        }
      }
    )


  }


  render() {
    return (
      <Router>
        <Switch >
          <Route
            path="/login"
            render={() => 
              <Login submit={this.submit} />
            }
          >
          </Route>
          <Route
            path="/home"
            render={() => 
              <Home userInfo={this.state.userInfo} >
                <Route path="/list" component={Content}></Route>
                <Route path="/detail" component={Detail}></Route>
              </Home>
            }
          >
          </Route>
        </Switch>

      </Router>);
  }
}


export default App;
